import Hero from "../components/Hero";
import Banner from "../components/Banner";
import {Link} from "react-router-dom";

const Rooms = () => {
    return (
        // <Hero hero='roomsHero'/>
        <Hero hero='roomsHero'>
            <Banner title="404" subtitle="page not found">
                <Link to="/ " className='btn-primary'>
                    Return Home
                </Link>
            </Banner>
        </Hero>
    )
}

export default Rooms
